import React from 'react';
import '../stylesheets/App.scss';
import fetchResult from '../services/Fetch';

class App extends React.Component {

  constructor (props){
    super (props)
    this.state = {
      data: [],
    }
  }
  //pintar la lista 
  renderList () {
    fetchResult ()
    .then(data => {
      console.log(data.results)
    this.setState({
      data: data.results
    })
    })
  }

  render() {
    const {data}= this.state
    return (
      <>
      <CharacterList
        list={data}
        />
      </>
    );
  }
}

export default App;
